import Jobs from './Jobs'
import classes from './Joblist.module.css'
const Joblist = (props)=>
{
    return (
        <ul className={classes['movies-list']}>
            {props.movies.map((i)=>
            (
                <Jobs 
                id={i.id}
                title={i.title}
                company= {i.company}
                description= {i.description}
                location = {i.location}
                />
            ))}
        </ul>
    )
}

export default Joblist;
